export class AddToDo extends Component {
    render() {
        return (
            <form>
                <input type = "text" 
                       name = "title" 
                       style = {{flex : '10', padding: '15px 455px'}}
                       placeholder = "Add List to do for future">
                </input>
                <input type = 'submit' 
                       value = 'Submit' 
                       className = "btn"
                       style = {{flex: 1}}>

                </input>

            </form>
        )
    }
}

export default AddToDo;
